import styled from "styled-components"

export const Background = styled.section`
position: relative;
display: flex;
justify-content: center;
align-items: center;
height: 100vh;
width: 100%;
box-sizing: border-box;
background: url('${Fundo}') no-repeat;
background-size: cover;
`;
